"""
Given an integer array arr and an integer k, modify the array by repeating it k times.

For example, if arr = [1, 2] and k = 3 then the modified array will be [1, 2, 1, 2, 1, 2].

Return the maximum sub-array sum in the modified array. Note that the length of the sub-array can be 0 and its sum in that case is 0.

As the answer can be very large, return the answer modulo 10^9 + 7.

 

Example 1:

Input: arr = [1,2], k = 3
Output: 9
Example 2:

Input: arr = [1,-2,1], k = 5
Output: 2
Example 3:

Input: arr = [-1,-2], k = 7
Output: 0
 

Constraints:

1 <= arr.length <= 10^5
1 <= k <= 10^5
-10^4 <= arr[i] <= 10^4
"""
class Solution:
    def maxSubarry(self,arr):
        if len(arr) == 0:
            return 0
        res = arr[0]
        tmp = arr[0]
        for a in arr[1:]:
            tmp = max(a, tmp+a)
            res = max(res, tmp)
        # print('res:',res)
        return max(res, 0)

    def kConcatenationMaxSum(self, arr, k):
        N = 1E9 + 7
        #if k > 1,maxSubarry is max subarry of arr + arr; res is maxSubarry + (k-2)*max(0,sum(arr))
        #if k == 1, maxSubarry is max subarry of arr; res is maxSubarry

        total = sum(arr)
        # print('total',total)

        if k > 1:
            arr2 = arr + arr
            subMax = self.maxSubarry(arr2)
            totalMax = max(0, (k-2)*total) + subMax
        else:
            subMax = self.maxSubarry(arr)
            totalMax = subMax
        return int(totalMax % N)

s = Solution()
arr = [1,-1]
k = 1
print(s.kConcatenationMaxSum(arr,k))
arr = [1,2]
k = 3
print(s.kConcatenationMaxSum(arr,k))

arr = [1,-2,1]
k = 5
print(s.kConcatenationMaxSum(arr,k))

arr = [-1,-2]
k = 7
print(s.kConcatenationMaxSum(arr,k))


